import React from 'react'
import '../GofundNFT.css';
import 'bootstrap/dist/css/bootstrap.min.css';


import Ellipse from "../images/Ellipse.png";
import Raio from "../images/raio.png";
import wallet from "../images/wallet.png";


function head(){
    return (
      <div class="container-fluid" style={{height:'70px'}}>
        <div class="row ">
          <div class=" col-12 mt-4" >
            <div id="corpoheader">
              <h1 style={{fontWeight:"bold", color:"#FDC921", marginLeft:"31px", fontSize:"22px"}}> GoNFT
              </h1>  

              <div  id="Utility">Utility Tokens</div>
              <div id="NFT">NFT</div>
              <div id="Educacao">Educação </div>
              <div id="bolha"><img  style={{}}             
                                src={Ellipse} 
                                class="img-fluid"  
                                alt="FundoGoTokens"
                                
                                >
                          </img>  
              </div>
              <div id="raio"><img  style={{}}             
                                src={Raio} 
                                class="img-fluid"  
                                alt="FundoGoTokens"
                                
                                >
                            </img>  
              </div>
              <div id="carteira">
              </div>
            </div>
          </div>  
        </div>
    </div>
        
    );
}

export default head;
